import React from 'react'
import '../css/Profile.css'

import UserService from '../services/user_service'



class Profile extends React.Component {
    constructor(props){
        super(props)
        this.state = {
            accessToken : undefined,
            firstname:"",
            lastname:"",
            username:"",
            password:"",
            email:"",
            gender:"",
            birthday:undefined,
            tel:undefined,
            groupname:"",

            acceptObj: {}
            
        }

        this.gotogroup = this.gotogroup.bind(this)
    }


    componentDidMount(){

         const profile_detail = UserService.profile();

         profile_detail.then((response) => {
            this.setState({
                firstname : response.first_name,
                lastname :  response.last_name,
                username :  response.username,
                password :  response.password,
                email :     response.email,
                gender :    response.gender,
                birthday :  response.birthday,
                tel :       response.tel,
                groupname:  response.group_name

            })
             
            })

    }

    render(){
        
    return (

        <div className="profile__background">
            <div className="profile__body">
                <h1 className="">{this.state.username}</h1>

                <h1 className="">{this.state.firstname}</h1>
                <h1 className="">{this.state.lastname}</h1>
              

                <h1 className="">{this.state.email}</h1>
                <h1 className="">{this.state.gender}</h1>
                <h1 className="">{this.state.birthday}</h1>
                <h1 className="">{this.state.tel}</h1>
                <h1 >{this.state.groupname}</h1>                              
            </div>
        </div>
    )
    }
}

export default Profile
